import React from 'react'
import Todo from './Todo'

export default function TodoList({ todos }) {

  console.log('from TodoList: ' + todos);
  // from TodoList: Todo 1,Todo 2

  return (
    todos.map(( todo, idx ) => {
      return <Todo key={ idx } todo={ todo } />
    })
  )
}
